import React from 'react';
import { Todo, MapTodo, DeleteTodo } from './../Types/index';
import './TodoListItem.css'

interface TodoListItemProps {
    todo: Todo,
    mapTodo: MapTodo,
    deleteTodo: DeleteTodo
}

const TodoListItem: React.FC<TodoListItemProps> = ({ todo, mapTodo, deleteTodo }) => {
    return (<li>
                <label className={todo.complete ? "complete" : undefined}>
                    <input type="checkbox" checked={todo.complete} onChange={() => mapTodo(todo)}/>
                    {todo.text}
                    <button onClick={() => {deleteTodo(todo)}}></button>
                </label>
            </li>)
}

export default TodoListItem;
